import React, {Component} from "react";
import Tabs from '@mui/material/Tabs';
import Tab from '@mui/material/Tab';
import { withStyles } from '@material-ui/styles';
import { red } from "@mui/material/colors";
import { minHeight } from "@mui/system";


const useStyles = theme => ({
    root: {

    },
    tabs: {
        minWidth: 50,
        position: 'absolute',
        top: -8,
        borderRadius: '0px 0px 0px 20px',
        color: white
    },
    tab: {

    },
    tabLabel: {
        marginTop: 7,
        fontWeight: 600,
        fontStyle: 'verdana'
    },
    indicator: {

    }
});

class NavTop extends Component {

    render(){

        const showNav = this.props.state.showNav

        return(
            <>
                <div className={`reset-options-container nav-top-${showNav ? 'active' : 'inactive'}`}>

                </div>
                <div className="progress-bar-container">

                </div>
                <div className={`speed-options-container nav-top-${showNav ? 'active' : 'inactive'}`} sx={{ width: '100%' }}>
                <Tabs
                    // value={value}
                    // onChange={handleChange}
                    textColor="secondary"
                    indicatorColor="secondary"
                    aria-label="secondary tabs example"
                    className={this.props.classes.tabs}
                    value={this.props.state.animationSpeed}
                    onChange={this.props.handleSpeedTabs}
                    variant="fullWidth"
                >
                    <Tab className={this.props.classes.tab} value={20} label={<span className={this.props.classes.tabLabel}>Slow</span>} />
                    <Tab className={this.props.classes.tab} value={10} label={<span className={this.props.classes.tabLabel}>Normal</span>} />
                    <Tab className={this.props.classes.tab} value={5} label={<span className={this.props.classes.tabLabel}>Fast</span>} />
                </Tabs>
                </div>
            </>
        )
    }
}

export default withStyles(useStyles)(NavTop)
